import React from "react";
import { useState } from "react";
import "../Style/Navbar.css";
import { Link } from "react-router-dom";

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);

  const toggleMenu = () => {
    setIsOpen(!isOpen);
  };
  return (
    <nav className="navbar">
      <div className="nav-logo">
        <i className="fa fa-user"></i> MyLogo
      </div>
      <div className={`nav-links ${isOpen ? "open" : ""}`}>
        <Link to="/adminportal/">HOME</Link>
        <Link to="/adminportal/book">BOOKS</Link>
        <Link to="/adminportal/addbook">ADD BOOKS</Link>
        <Link to="/adminportal/users">USERS</Link>
        <Link to="/adminportal/addusers">ADD USERS</Link>
        <Link to="/">LOGOUT</Link>
      </div>
      <div className="nav-toggle" onClick={toggleMenu}>
        <i className="fa fa-bars"></i>
      </div>
    </nav>
  );
};

export default Navbar;
